import React from 'react';
import './App.css';
import Auth from './Auth';
import Registration from './Registration';

interface isLoggedIn{
  isLogged
}

function isLogged(props: boolean){

  const isLoggedIn = props.isLoggedIn;
  if(isLoggedIn == true) return <Auth/>
}
function isRegistrated(props: boolean){
  const isRegistratedIn = props.isRegistratedIn;
  if(isRegistrated == true) return <Registration/>
}



function App() {
  return (
    <div className = 'btn-block'>
      <isLogged isLoggedIn = {true}/>
      <isRegistrated isRegistratedIn = {true}/>
      {/* <button className = 'btn' onClick = {()=>isLogged}>Login</button> */}
      <button className = 'btn' onClick = {()=>isRegistrated}>Sign up</button>
    </div>
  );
}

export default App;
